function Finished({ point, maxPoints }) {
  const percentage = (point / maxPoints) * 100;
  return (
    <>
      <p className="result">
        You scored {point} out of {maxPoints} ({Math.ceil(percentage)} %)
      </p>
      <p className="highscore">(Highscore: X points) </p>
    </>
  );
}

export default Finished;
